import React from 'react';
import Logo from './Logo';
import Navigation from './Navigation';
import {Mug} from 'react-kawaii';

const DEFAULT_MOOD = 'happy';

class About extends React.Component {

    state = {
        mood: ''
    };

    componenDidMount() {
        this.setState({mood: DEFAULT_MOOD});
    }

    render() {
        return (
            <div>
                <p />
                <div className="row" style={{height: "65px"}}>
                    <div className="ui grid">
                        <div className="column" />
                        <div className="three wide column">
                            <Logo />
                        </div>
                        <div className="eight wide column">
                        </div>
                        <div className="two wide column" />
                        <div className="two wide column" >
                            <Navigation />
                        </div>
                    </div>
                </div>
                <p />
                <div className="ui fitted divider" />
                <Mug size={200} mood={this.state.mood} color="#FDA7DC" text="Hello World!" />
            </div>
        );
    }
}

export default About;
